import PropTypes from 'prop-types';

class TopNavBar extends PureComponent {
    render() {
        return (
            <div>
                <h1 className={"App-header"}>top navigation bar</h1>
            </div>
        );
    }
}

TopNavBar.propTypes = {};

export default TopNavBar;
